    <script>
        
        document.addEventListener("DOMContentLoaded", () => {
            
            const slider = document.getElementById("slider");
            const dateOutputs = document.getElementsByClassName("date-picked");
            const priceOutput = document.getElementById("btc-price");
            const investmentInput = document.getElementById("number");
            const resultOutput = document.getElementById("newnumber");
    
            
            if (!slider || dateOutputs.length === 0 || !priceOutput || !investmentInput || !resultOutput) {
                console.error("One or more required elements are missing in the DOM.");
                return;
            }
    
            
            const prices = [ 0.0858 , 0.0618 , 0.1931 , 0.265 , 0.949 , 1 , 29.6 , 13.0946 , 5.4683 , 2.25 , 6.36 , 4.82 , 4.9794 , 6.6801 , 12.19 , 11.8 , 12.565 , 17.5 , 59.14 , 115 , 68.431 , 122.62 , 182.21 , 872.6 , 712.4 , 437.14 , 583.424 , 628.628 , 479.645 , 330.717 , 312.307 , 244.376 , 228.615 , 229.103 , 282.624 , 234.384 , 326.053 , 439.521 , 407.607 , 455.225 , 588.221 , 577.35 , 616.607 , 777.709 , 901.297 , 1053.31 , 1796.03 , 2520.75 , 4568.66 , 5946.926591898 , 19427.474509164 , 8256.155151159 , 7454.691790393 , 7149.250597223 , 7400.986497236 , 6501.145617091 , 6428.294584816 , 3863.165983794 , 3970.590294199 , 5309.256996284 , 7962.756329737 , 10948.187619903 , 8183.569872359 , 8097.187492427 , 8116.969510017 , 8042.736084463 , 8832.98125113 , 9289.303604875 , 12285.936628884 , 11294.994190302 , 18737.192660312 , 30305.343778842 , 54249.990775698 , 46786.61 , 32837.96027303372 , 47225.2696 , 62989.54469958203 , 46871.01844345239 , 43524.3779183224 , 45573.53741324558 , 29445.7241 , 22701.085 , 19662.3883 , 18528.52092702272 , 16607.069459238443 , 23197.7565 , 28804.98 , 25887.59 , 29086.65 , 26910.69 , 37448.77 , 42611.43 , 68513.59 , 59134.5 , 60761.24 , 59562.71 , 63216.04 , 97013.92 , 101344 , 87365.98 ];
            const dates = ["2010-07-18","2010-09-10","2010-11-03","2010-12-27","2011-02-19","2011-04-14","2011-06-08","2011-08-01","2011-09-24","2011-11-17","2012-01-10","2012-03-04","2012-04-28","2012-06-21","2012-08-14","2012-10-07","2012-11-30","2013-01-23","2013-03-19","2013-05-12","2013-07-05","2013-08-28","2013-10-21","2013-12-14","2014-02-07","2014-04-02","2014-05-26","2014-07-19","2014-09-11","2014-11-04","2014-12-29","2015-02-21","2015-04-16","2015-06-09","2015-08-02","2015-09-26","2015-11-19","2016-01-12","2016-03-06","2016-04-29","2016-06-22","2016-08-16","2016-10-09","2016-12-02","2017-01-25","2017-03-20","2017-05-13","2017-07-07","2017-08-30","2017-10-23","2017-12-16","2018-02-08","2018-04-03","2018-05-28","2018-07-21","2018-09-13","2018-11-06","2018-12-30","2019-02-22","2019-04-18","2019-06-11","2019-08-04","2019-09-27","2019-11-20","2020-01-13","2020-03-08","2020-05-01","2020-06-24","2020-08-17","2020-10-10","2020-12-04","2021-01-27","2021-03-22","2021-05-15","2021-07-08","2021-08-31","2021-10-25","2021-12-18","2022-02-10","2022-04-05","2022-05-29","2022-07-22","2022-09-15","2022-11-08","2023-01-01","2023-02-24","2023-04-19","2023-06-12","2023-08-06","2023-09-29","2023-11-22","2024-01-15","2024-03-09","2024-05-02","2024-06-26","2024-08-19","2024-10-12","2024-12-05","2025-01-28","2025-03-24"];
    
            
            Array.from(dateOutputs).forEach(el => el.textContent = dates[0]);
            priceOutput.textContent = prices[0];
    
            
            slider.addEventListener("input", () => {
                const index = parseInt(slider.value);
                Array.from(dateOutputs).forEach(el => el.textContent = dates[index]);
                priceOutput.textContent = prices[index].toFixed(2); 
            });
    
            
            async function fetchBitcoinPrice() {
                try {
                    const response = await fetch('https://api.coingecko.com/api/v3/simple/price?ids=bitcoin&vs_currencies=usd');
                    const data = await response.json();
                    return data.bitcoin.usd;
                } catch (error) {
                    console.error("Error fetching BTC price:", error);
                    return null;
                }
            }
    
            
            async function calculate() {
                const usdInvested = parseFloat(investmentInput.value) || 0;
                const selectedPrice = parseFloat(prices[slider.value]);
                if (usdInvested <= 0 || !selectedPrice || isNaN(selectedPrice)) {
                    resultOutput.textContent = "Enter a valid USD amount and select a date";
                    return;
                }
    
                const btcBought = usdInvested / selectedPrice;
                const currentPrice = await fetchBitcoinPrice();
    
                if (currentPrice) {
                    const todayValue = (btcBought * currentPrice).toLocaleString("en-US", { style: "currency", currency: "USD" });
                    resultOutput.textContent = todayValue;
                } else {
                    resultOutput.textContent = "Error fetching current price";
                }
            }
    
            
            const form = document.querySelector("form");
            form.addEventListener("submit", (event) => {
                event.preventDefault(); 
                calculate();
            });
        });
